const Multislider = (props) => {

    const { type } = props

    const sliderStyle = {
        position: 'absolute',
        webkitAppearance: 'none',
        mozAppearance: 'none',
        appearance: 'none',
        backgroundColor: 'transparent',
        pointerEvents: 'none',
    }

    return (
        <>
            <input type='range' min='1' max='100' style={sliderStyle}></input>
            <input type='range' min='1' max='100' style={sliderStyle}></input>
            <div className='bg-slate-400 w-full h-1'></div>
        </>
    )
}

export default Multislider
